 import React from 'react'
 import './footer.css'

import {Container,Row,Col} from 'reactstrap';
import {Link} from 'react-router-dom';

 const Footer = () => {
   return (
     <section>
      <Container>
        <Row>
          <Col></Col>
        </Row>
      </Container>
     </section>
   )
 }
 
 export default Footer
